package se.hallqvist.adventofcode2018.day05

import org.scalatest._

/*
--- Day 5: Alchemical Reduction ---
You've managed to sneak in to the prototype suit manufacturing lab. The Elves are making decent progress, but are still struggling with the suit's size reduction capabilities.

While the very latest in 1518 alchemical technology might have solved their problem eventually, you can do better. You scan the chemical composition of the suit's material and discover that it is formed by extremely long polymers (one of which is available as your puzzle input).

The polymer is formed by smaller units which, when triggered, react with each other such that two adjacent units of the same type and opposite polarity are destroyed. Units' types are represented by letters; units' polarity is represented by capitalization. For instance, r and R are units with the same type but opposite polarity, whereas r and s are entirely different types and do not react.

For example:

In aA, a and A react, leaving nothing behind.
In abBA, bB destroys itself, leaving aA. As above, this then destroys itself, leaving nothing.
In abAB, no two adjacent units are of the same type, and so nothing happens.
In aabAAB, even though aa and AA are of the same type, their polarities match, and so nothing happens.
Now, consider a larger example, dabAcCaCBAcCcaDA:

dabAcCaCBAcCcaDA  The first 'cC' is removed.
dabAaCBAcCcaDA    This creates 'Aa', which is removed.
dabCBAcCcaDA      Either 'cC' or 'Cc' are removed (the result is the same).
dabCBAcaDA        No further actions can be taken.
After all possible reactions, the resulting polymer contains 10 units.

How many units remain after fully reacting the polymer you scanned? (Note: in this puzzle and others, the input is large; if you copy/paste your input, make sure you get the whole thing.)


--- Part Two ---
Time to improve the polymer.

One of the unit types is causing problems; it's preventing the polymer from collapsing as much as it should. Your goal is to figure out which unit type is causing the most problems, remove all instances of it (regardless of polarity), fully react the remaining polymer, and measure its length.

For example, again using the polymer dabAcCaCBAcCcaDA from above:

Removing all A/a units produces dbcCCBcCcD. Fully reacting this polymer produces dbCBcD, which has length 6.
Removing all B/b units produces daAcCaCAcCcaDA. Fully reacting this polymer produces daCAcaDA, which has length 8.
Removing all C/c units produces dabAaBAaDA. Fully reacting this polymer produces daDA, which has length 4.
Removing all D/d units produces abAcCaCBAcCcaA. Fully reacting this polymer produces abCBAc, which has length 6.
In this example, removing all C/c units was best, producing the answer 4.

What is the length of the shortest polymer you can produce by removing all units of exactly one type and fully reacting the result?
*/

class Day05 extends FlatSpec {
  val input = ""
  val p = ('a' to 'z').flatMap { c => val l = c.toString; val u = l.toUpperCase; Seq(l + u, u + l) }.mkString("|").r
  def r(s: String): String = { val n = p.replaceAllIn(s, ""); if (n != s) r(n) else s }

  def part1(s: String) = r(s).length

  "part1" should "satisfy the examples given" in {
    assertResult(0)(part1("aA"))
    assertResult(0)(part1("abBA"))
    assertResult(4)(part1("abAB"))
    assertResult(6)(part1("aabAAB"))
    assertResult(10)(part1("dabAcCaCBAcCcaDA"))
  }

  "part1" should "succeed" in { info(part1(input).toString) }

  def part2(s: String) =
    ('a' to 'z').map { c => val l = c.toString; val u = l.toUpperCase; part1(s"$l|$u".r.replaceAllIn(s, "")) }.min

  "part2" should "satisfy the examples given" in {
    assertResult(4)(part2("dabAcCaCBAcCcaDA"))
  }

  "part2" should "succeed" in { info(part2(input).toString) }
}
